import React from 'react'
import styled from 'styled-components'

function Profile(){
    const ProfileWrapper = styled.div`
    margin: 0;
    padding: 0;
    box-sizing: border-box;
    width: 100%;
    height: 100%;
    display: grid;
    grid-template-columns: repeat(12, 1fr);

    `
    return (
        <ProfileWrapper>
        </ProfileWrapper>
    )
}

export default Profile
